package com.js;import lombok.*;import javax.persistence.*;@Data@AllArgsConstructor@NoArgsConstructor(access = AccessLevel.PROTECTED)@Entity(name="member")public class MemberVo {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long mbrNo;    private String id;    private String names;    @Builder    public MemberVo(String id, String names) { this.id = id; this.names = names; }}